import {doPostAsync} from "../api";
import authHeader from "../user/auth-header";
import {ip, tomcatPort} from '../../misc/constants';

const getChargerOperatingMode = (id) => {
    return new Promise((resolve, reject) =>
        doPostAsync(`http://${ip}:${tomcatPort}/api/charger/getOperatingMode`, {id: id}, authHeader()).then(x => {
            console.log(x.data.operatingMode);
            resolve(JSON.parse(x.data));
        }).catch((error) => {
            reject(error);
        }));
}

export default getChargerOperatingMode;
